import styled from "styled-components";
import { DetailBox } from "../DetailCard/styled";

export const EnrollBox = styled(DetailBox)`
  height: 108px;
  border-radius: 0.25rem;
  border: 0.5px solid #c4c4c4;
  font-size: 20px;
  display: flex;
  align-items: center;
  padding: 32px;
  box-shadow: 3px 5px 5px #c4c4c4, 5px -30px 60px #ebebeb;
  height: 60px;
  box-shadow: none;
`;
